import fetch from 'isomorphic-unfetch'; // For fetch API
import Head from 'next/head';
import { Component } from 'react';
import Link from 'next/link';
import Layout from '../components/MyLayout';
import { post } from 'axios';

class SignupForm extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			username : '',
			password : '',
			redirect : false
		};
	}
	// state = {
	//     username: '',
	//     password: ''
	// }

	handleChange = (event) => {
		this.setState({ [event.target.name]: event.target.value });
	};

	handleSubmit = (event) => {
		event.preventDefault;
		console.log(this.state);
		let request = { auth: { username: this.state.username, password: this.state.password } };

		fetch('/api/user_token', {
			body    : JSON.stringify(this.state),
			method  : 'POST',
			headers : {
				Accept         : 'application/json, text/plain, */*',
				'Content-Type' : 'application/json'
			}
		})
			.then((createdUser) => {
				return createdUser.json();
			})
			.then(() => {
				this.setState({
					redirect : true
				});
			})
			.catch((error) => console.log(error));
	};

	// static async getInitialProps() {
	// 	const res = await fetch('http://localhost:3000/poses');
	// 	const statusCode = res.status > 200 ? res.status : false;
	// 	const data = await res.json();
	// 	console.log(`Yoga exercises data fetched. Count: ${data.length}`);

	// 	return {
	// 		// poses : data.map((entry) => entry.pose)
	// 		poses      : data,
	// 		statusCode
	// 	};
	// }

	// handleSubmit = event => {
	//     event.preventDefault();

	//     // const { username, password } = this.state;
	//     // console.log(this.state);

	//     const username = document.getElementById('username').value;
	//     const password = document.getElementById('password').value;

	//     const request = {"auth": {"username": username, "password": password }};

	//     post('/api/user_token', request)
	//         .then(response => {
	//             localStorage.setItem("jwt", response.data.jwt);
	//             this.props.history.push("/")
	//         })
	//         .catch(error => console.log("Login erro", error));

	//     // loginUser(username, password)
	// }

	render() {
		if (this.state.redirect === true) {
			return <Redirect to="/login" />;
		}

		return (
			<Layout title="Sign Up Page">
				<Head>
					<title>Sign Up</title>
					<link
						rel="stylesheet"
						href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
						integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T"
						crossorigin="anonymous"
					/>
				</Head>

				<div className="bodyCenter">
					<form onSubmit={this.handleSubmit} className="form-signin">
						<img
							className="mb-4"
							src="data:image/png;base64,"
							alt=""
							width="120"
							height="120"
						/>
						<h1 className="h3 mb-3 font-weight-normal">Sign up!</h1>
						<label htmlFor="username" className="sr-only">
							Username
						</label>
						<input
							type="username"
							id="username"
							name="username"
							className="form-control"
							placeholder="Username"
							value={this.state.username}
							onChange={this.handleChange}
							required=""
						/>
						<label htmlFor="password" className="sr-only">
							Password
						</label>
						<input
							type="password"
							id="password"
							name="password"
							className="form-control"
							placeholder="Password"
							required=""
							value={this.state.password}
							onChange={this.handleChange}
						/>

						<button className="btn btn-lg btn-primary btn-block" type="submit" value="submit">
							Sign Up!
						</button>
					</form>
				</div>

				<style jsx>{`
					.bodyCenter {
						width: 350px;
						display: block;
						margin: 0 auto;
						padding-top: 5%;
						padding-bottom: 5%;
						text-align: center;
					}
				`}</style>
			</Layout>
		);
	}
}

export default SignupForm;
